import React, { useEffect } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { startGetWishlists } from '../Actions/wishlist'
import { Col, Card, Button } from 'react-bootstrap'

const WishlistItems = () => {
  const dispatch = useDispatch()
  const wishlistItems = useSelector(state => state.wishlist.data)

  useEffect(() => {
    dispatch(startGetWishlists())
  }, [dispatch])

  return (
    <div>
      <h2>Wishlist Items</h2>
      <div className="row">
        {wishlistItems.map(item => (
          <Col key={item._id} lg={4} md={6} className="mb-4">
            <Card>
              <Card.Img variant="top" src={item.images} />
              <Card.Body>
                <Card.Title>{item.caption}</Card.Title>
                <Card.Text>
                  Price: {item.price}
                </Card.Text>
                <Button variant="primary">Add to Cart</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </div>
    </div>
  )
}

export default WishlistItems
